import React from "react";
import { Star } from "@material-ui/icons";
const RatingsFilterItems = props => {
    const starRatingNum = [5, 4, 3, 2, 1];
    console.log(props);
    return ( <
        ul > {
            starRatingNum.map((ratingNum, i) => ( <
                li key = { ratingNum }
                className = "ratings__dropdonw-items p-2" >
                <
                div >
                <
                input type = "checkbox"
                className = "mr-2"
                onClick = {
                    () => onStarSelect() }
                /> { ratingNum } <
                /div> <
                span className = "ml-2" > {
                    Array(ratingNum).fill( <
                        Star fontSize = { "small" }
                        color = { "secondary" }
                        />
                    )
                } <
                /span> <
                /li>
            ))
        } <
        /ul>
    );
};

export default RatingsFilterItems;
